import React from "react";

const SignInForm = () => {

    const handleChange = (event) => {
        console.loog(event)
    }

    return (
        <>
             <h1>Please sign in</h1>
            <form>
                <label htmlFor="displayName">Display Name</label>
                <input type="text" name="displayName" onChange={handleChange} />

                <label htmlFor="mail">E-Mail</label>
                <input type="email" name="mail" onChange={handleChange} />

                <label htmlFor="password">Passwort</label>
                <input type="password" name="password" onChange={handleChange} />

                <label htmlFor="passwordAgain">Passwort</label>
                <input type="password" name="passwordAgain" onChange={handleChange} />

            </form>
        </>
    )
}

export default SignInForm;
